import React from 'React/index';

class Hello extends React.Component {
    render () {
        return (
            <div class="Hello">
                <h1>Hello</h1>
                <p>I'm on: </p>
                <ul>
                    <li>Instagram</li>
                    <li>WhatsApp</li>
                    <li>Oculus</li>
                </ul>
            </div>
        );
    }
}

export default Hello;
